import "./Cell.css"

class Cell extends Component {



  componentDidMount = () => {
    coords = this.props.lightCoordinates(this.props.id);
  }

  render() {
    return (
  <td className="Cell">{this.coords}</td>
    )
  }
}


export default Cell
